import React from 'react';
import { Div } from '../../../assets/style';
import { Tabs } from 'antd';
import "./index.css";
const { TabPane } = Tabs;



const Tab = () => {
  return (
    <Div w={1160} h={1000}>
   <Tabs defaultActiveKey="2">
    <TabPane
      tab={
        <span>

          Tab 1
        </span>
      }
      key="1" >
      Tab 1
    </TabPane>
    <TabPane
      tab={
        <span>

          Tab 2
        </span>
      }
      key="2">
      Tab 2
    </TabPane>
  </Tabs>,

  </Div>
  )
}





export default Tab;
